class DynamicSuite{static call(package_id,api_id,data,callback){fetch("/dynamicsuite/api/"+package_id+"/"+api_id,{method:"POST",body:JSON.stringify(data?data:[])}).then(response=>{if(response.ok){return response}throw new Error("A server error has occurred")}).then(response=>response.json()).then(json=>callback(json),json=>callback({status:"SERVER_ERROR",message:"A malformed response was returned",data:null})).catch(()=>{callback({status:"SERVER_ERROR",message:"A malformed response was returned",data:null})})}static initView(){this.nav=document.getElementById("ds-nav-container");if(this.nav===null){return false}this.view=document.getElementById("ds-view-container");this.groups=document.getElementsByClassName("ds-nav-group");this.mobile_toggle_btn=document.getElementById("ds-nav-mobile-toggle");window.onresize=(()=>{if(!this.isMobile()){this.nav.classList.remove("ds-nav-show-mobile")}});for(let i=0,c=this.groups.length;i<c;i++){this.groups[i].addEventListener("click",()=>{let hidden=this.groups[i].nextElementSibling.classList.contains("ds-hide"),sublinks=this.groups[i].nextElementSibling.classList,chevron=this.groups[i].lastElementChild.classList;this.clearNav();this.groups[i].classList.add("ds-nav-selected");sublinks.replace(hidden?"ds-hide":"ds-show",hidden?"ds-show":"ds-hide");chevron.replace(hidden?"fa-chevron-right":"fa-chevron-down",hidden?"fa-chevron-down":"fa-chevron-right")})}this.mobile_toggle_btn.addEventListener("click",()=>{this.nav.classList.toggle("ds-nav-show-mobile")})}static clearNav(){for(let i=0,c=this.groups.length;i<c;i++){this.groups[i].classList.remove("ds-nav-selected");this.groups[i].nextElementSibling.classList.remove("ds-show");this.groups[i].nextElementSibling.classList.add("ds-hide");this.groups[i].lastElementChild.classList.replace("fa-chevron-down","fa-chevron-right")}}static isMobile(){return window.innerWidth<1280}}DynamicSuite.initView();